#include "sprites.h"
#include "platform.h"

void CopySprite(const color_t* sprite, int x, int y, int width, int height, int mode, int flip)
{
	x -= width / 2;
	y -= height / 2;
	color_t* VRAM = (color_t*)GetVRAMAddress();
	VRAM += LCD_WIDTH_PX*y + x;
	sprite -= flip;
	for (int j = y; j < y + height; j++)
	{
		sprite += flip * width;
		for (int i = x; i < x + width; i++)
		{
			if (i >= 0 && j >= 24 && i < 384 && j < 216 && *(sprite) != 0xffff)
			{
				color_t c = *sprite;
				if ((mode == 1) && c != 0) c = 0xffff - c;
				*VRAM = c; 
			}
			VRAM++;
			sprite += 1 - 2 * flip;
		}
		sprite += flip * width;
		VRAM += LCD_WIDTH_PX - width;
	}
}

void CopySpriteScale(const color_t* sprite, int x, int y, int width, int height, int mode, int hratio, int vratio, int rotation)
{
	if (hratio == 0 || vratio == 0) return;
	color_t* VRAM = (color_t*)GetVRAMAddress();
	for (int j = 0; j < height; j++)
	{
		int dy = ((height - 1) * (32 - vratio) + j * vratio) / 32 - height / 2;
		for (int i = 0; i < width; i++)
		{
			int dx = ((width - 1) * (16 - hratio) + 2 * i * hratio) / 32 - width / 2;
			int sx, sy;
			switch(rotation & 3)
			{
			case 0:
				sx = x + dx;
				sy = y + dy;
				break;
			case 1:
				sx = x - dy;
				sy = y + dx;
				break;
			case 2:
				sx = x - dx;
				sy = y - dy;
				break;
			case 3:
				sx = x + dy;
				sy = y - dx;
				break;
			}
			if (sy >= 24 && sy < LCD_HEIGHT_PX && sx >= 0 && sx < 384 && sprite[width*j + i] != 0xffff)
			{
				color_t c = sprite[width*j + i];
				if ((mode == 1) && c != 0) c = 0xffff - c;
				*(VRAM + LCD_WIDTH_PX*sy + sx) = c;
			}
		}
	}
}

void CopySpriteAlpha(const color_t* sprite, int x, int y, int width, int height, int mode, int alpha)
{
	x -= width / 2;
	y -= height / 2;
	color_t* VRAM = (color_t*)GetVRAMAddress();
	VRAM += LCD_WIDTH_PX*y + x;
	for (int j = y; j < y + height; j++)
	{
		for (int i = x; i < x + width; i++)
		{
			if (i >= 0 && j >= 24 && i < 384 && j < 216 && *(sprite) != 0xffff)
			{
				color_t c = *sprite;
				if ((mode == 1) && c != 0) c = 0xffff - c;
				*VRAM = (color_t) (
					((((c >> 11) * alpha + (*VRAM >> 11) * (32 - alpha)) / 32) << 11) +
					(((((c >> 5) & 0x3f) * alpha + ((*VRAM >> 5) & 0x3f) * (32 - alpha)) / 32) << 5) +
					(((c & 0x1f) * alpha + (*VRAM & 0x1f) * (32 - alpha)) / 32));
			}
			VRAM++;
			sprite++;
		}
		VRAM += LCD_WIDTH_PX - width;
	}
}


